import {UPDATE_QUERY} from '../actions';

const INITAL_STATE={
  query:''
}
export default function videos(state=INITAL_STATE,action){
  switch(action.type){
    case UPDATE_QUERY:
      return {
        ...state,
        query:action.query
      }
      default :
      return state;
  }
}
